    // Get (x,y) array from vertex array(polygon)
    let xs = [];
    let ys = [];

    polygons.forEach((polygon) => {
      xs = xs.concat(polygon.map((v) => v.x));
      ys = ys.concat(polygon.map((v) => v.y));
    });
